Here is a sample Spark job to calculate the hit rate for onsite attributed data:

```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import org.apache.spark.api.java.function.VoidFunction;
import scala.Tuple2;

import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {

    public static void main(String[] args) {
        // Initialize Spark session
        SparkSession spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate();

        // Load onsite attributed data
        JavaRDD<String> onsiteData = spark.read().textFile("onsite_data.txt").javaRDD();

        // Load top frequent queries
        JavaRDD<String> topQueries = spark.read().textFile("top_queries.txt").javaRDD();

        // Convert top queries to a map for faster lookup
        final Map<String, Long> topQueriesMap = topQueries.collectAsMap();

        // Filter onsite data to only include queries present in top queries
        JavaRDD<String> filteredOnsiteData = onsiteData.filter(new Function<String, Boolean>() {
            @Override
            public Boolean call(String line) throws Exception {
                String[] parts = line.split(",");
                return topQueriesMap.containsKey(parts[0]);
            }
        });

        // Calculate cache hits and misses
        final Map<String, Long> cache = new HashMap<>();
        final Map<String, Integer> hitMissCount = new HashMap<>();
        filteredOnsiteData.foreach(new VoidFunction<String>() {
            @Override
            public void call(String line) throws Exception {
                String[] parts = line.split(",");
                String query = parts[0];
                long timestamp = Long.parseLong(parts[1]);

                if (!cache.containsKey(query) || cache.get(query) < timestamp - 12 * 60 * 60 * 1000) {
                    // Cache miss
                    hitMissCount.put(query, hitMissCount.getOrDefault(query, 0) + 1);
                    cache.put(query, timestamp);
                } else {
                    // Cache hit
                    hitMissCount.put(query, hitMissCount.getOrDefault(query, 0) - 1);
                }
            }
        });

        // Calculate hit rate
        long totalQueries = filteredOnsiteData.count();
        long totalHits = hitMissCount.values().stream().filter(count -> count > 0).count();
        double hitRate = (double) totalHits / totalQueries;

        System.out.println("Hit rate: " + hitRate);

        // Stop Spark session
        spark.stop();
    }
}
```

This job first filters the onsite attributed data to only include queries present in the top frequent queries dataset. Then, it calculates the cache hits and misses for each query by checking if the query is already cached and if the cache is still valid (i.e., the timestamp is within the last 12 hours). Finally, it calculates the hit rate by dividing the total number of cache hits by the total number of queries.

