Here's an example of how you might write the `onSubmit` function for a form using React and Apollo Client for GraphQL:
```javascript
import React from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations'; // Import your mutation

function MyForm() {
  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();

    // Get form data
    const formData = new FormData(event.target);
    const data = Object.fromEntries(formData);

    try {
      // Send data to GraphQL API
      const response = await addData({ variables: { data } });
      console.log('Data added:', response);
    } catch (error) {
      console.error('Error adding data:', error);
    }
  };

  return (
    <form onSubmit={onSubmit}>
      {/* Your form fields go here */}
      <button type="submit">Submit</button>
    </form>
  );
}

export default MyForm;
```
In this example, we're using the `useMutation` hook from Apollo Client to execute a mutation. The mutation is defined in a separate file and imported as `ADD_DATA`.

The `onSubmit` function is called when the form is submitted. It prevents the default form submission behavior, gets the form data, and sends it to the GraphQL API using the `addData` function returned by `useMutation`.

If the mutation is successful, the response is logged to the console. If there's an error, it's caught and logged to the console.

