I18n (Internationalization) violations in a library or book order platform can occur in various ways. Here are a few examples:

1. Hardcoded strings:

```javascript
function displayBookTitle(book) {
  return "Book Title: " + book.title;
}
```

In this example, the string "Book Title: " is hardcoded, which makes it difficult to translate into other languages.

To fix this issue, you can use a library like i18next to manage translations:

```javascript
import i18n from 'i18next';
import { initReactI18next } from 'react-i18next';

i18n
  .use(initReactI18next)
  .init({
    resources: {
      en: {
        translation: {
          "bookTitle": "Book Title: "
        }
      },
      fr: {
        translation: {
          "bookTitle": "Titre du livre: "
        }
      }
    },
    lng: 'en',
    fallbackLng: 'en',
    interpolation: {
      escapeValue: false
    }
  });

function displayBookTitle(book) {
  return i18n.t('bookTitle') + book.title;
}
```

In this fixed example, the hardcoded string is replaced with a key ("bookTitle") that can be translated into different languages using the i18next library.

