```go
package main

import (
	"fmt"
	"log"
	"net"
	"sync"

	"github.com/miekg/dns"
)

var (
	ipsMap     = make(map[string][]string)
	ipsMapLock sync.Mutex
)

func main() {
	dns.HandleFunc(".", handleRequest)

	server := &dns.Server{
		Addr: ":53",
		Net:  "udp",
	}

	err := server.ListenAndServe()
	if err != nil {
		log.Fatal(err)
	}
}

func handleRequest(w dns.ResponseWriter, r *dns.Msg) {
	m := new(dns.Msg)
	m.SetReply(r)

	for _, q := range r.Question {
		ips, err := resolveIP(q.Name)
		if err != nil {
			log.Printf("Error resolving IP for %s: %v\n", q.Name, err)
			continue
		}

		for _, ip := range ips {
			a := new(dns.A)
			a.Hdr = dns.RR_Header{Name: q.Name, Rrtype: dns.TypeA, Class: dns.ClassINET, Ttl: 0}
			a.A = net.ParseIP(ip)
			m.Answer = append(m.Answer, a)
		}
	}

	w.WriteMsg(m)
}

